import React from "react";
import axios from "axios";

import WeatherIcon from "./WeatherIcon";

import "./WeatherForecast.css";

export default function WeatherForecast(props) {
  function displayForecast(response) {
    console.log(response.data);
  }

  let apiKey = "477355458f09adef7ea7ed5ab3947103";
  let units = "metric";
  let lat = props.coordinates.lat;
  let lon = props.coordinates.lon;
  let apiEndpoint = "https://api.openweathermap.org/data/2.5/onecall?";
  let apiUrl = `${apiEndpoint}lat=${lat}&lon=${lon}&appid=${apiKey}&units=${units}`;
  axios.get(apiUrl).then(displayForecast);

  if (forecastDisplayed) {
    return (
      <div className="WeatherForecast">
        <div className="row">
          <div className="col">
            <div className="WeatherForecast-day">Wed</div>
            <WeatherIcon code="800" />
            <div className="WeatherForecast-temperatures">
              <span className="WeatherForecast-max">24°</span>
              <span className="WeatherForecast-min">11°</span>
            </div>
          </div>
        </div>
      </div>
    );
  }
}
